import React, { useState, useEffect } from 'react';
import { Link, useNavigate, useLocation } from 'react-router-dom';
import { FiMail, FiLock, FiUser, FiPhone, FiMapPin, FiHome } from 'react-icons/fi';
import { FcGoogle } from 'react-icons/fc';
import { useAuth } from '../context/AuthContext.js';
import './Register.css';

const Register = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const { register, error: authError, isAuthenticated } = useAuth();
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    mobile: '',
    password: '',
    confirmPassword: ''
  });
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  // Redirect if already logged in
  useEffect(() => {
    if (isAuthenticated) {
      const from = location.state?.from?.pathname || '/';
      navigate(from);
    }
  }, [isAuthenticated, navigate, location]);

  // Update local error state when auth context error changes
  useEffect(() => {
    if (authError) {
      setError(authError);
    }
  }, [authError]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
    if (error) setError('');
  };

  const resetForm = () => {
    setFormData({
      name: '',
      email: '',
      mobile: '',
      password: '',
      confirmPassword: ''
    });
    setError('');
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setLoading(true);

    try {
      // Validate input
      if (!formData.name || !formData.email || !formData.password || !formData.confirmPassword) {
        throw new Error('All required fields must be filled');
      }

      if (formData.password !== formData.confirmPassword) {
        throw new Error('Passwords do not match');
      }

      // Validate mobile number if provided
      if (formData.mobile) {
        const mobileRegex = /^[0-9]{10}$/;
        if (!mobileRegex.test(formData.mobile)) {
          throw new Error('Please enter a valid 10-digit mobile number');
        }
      }

      // Call the register function from AuthContext
      await register({
        name: formData.name,
        email: formData.email,
        mobile: formData.mobile,
        password: formData.password
      });

      // Clear form on success
      resetForm();

      // Navigation is handled by the useEffect hook watching isAuthenticated
    } catch (error) {
      setError(error.message || 'Failed to create account');
      // Clear passwords on error
      setFormData(prev => ({
        ...prev,
        password: '',
        confirmPassword: ''
      }));
    } finally {
      setLoading(false);
    }
  };

  const handleSocialRegister = (platform) => {
    alert(`${platform} registration is not implemented yet.`);
  };

  // For testing/demo purposes
  const fillTestCredentials = () => {
    setFormData({
      name: 'New User',
      email: 'newuser@example.com',
      mobile: '9876543210',
      password: 'password',
      confirmPassword: 'password'
    });
  };

  return (
    <div className="register-page">
      <div className="register-container">
        <div className="register-header">
          <h1>Create Account</h1>
          <p>Join us for a delicious food journey</p>
        </div>

        {error && (
          <div className="error-message">
            {error}
            <button className="clear-error-btn" onClick={() => setError('')}>×</button>
          </div>
        )}

        <form onSubmit={handleSubmit} className="register-form">
          <div className="form-group">
            <label htmlFor="name">Full Name *</label>
            <div className="input-wrapper">
              <FiUser className="icon" />
              <input
                type="text"
                id="name"
                name="name"
                value={formData.name}
                onChange={handleChange}
                placeholder="Enter your full name"
                required
                disabled={loading}
              />
              {formData.name && (
                <button 
                  type="button"
                  className="clear-input-btn"
                  onClick={() => setFormData(prev => ({ ...prev, name: '' }))}
                >
                  ×
                </button>
              )}
            </div>
          </div>

          <div className="form-group">
            <label htmlFor="email">Email Address *</label>
            <div className="input-wrapper">
              <FiMail className="icon" />
              <input
                type="email"
                id="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                placeholder="Enter your email"
                required
                disabled={loading}
              />
              {formData.email && (
                <button 
                  type="button"
                  className="clear-input-btn"
                  onClick={() => setFormData(prev => ({ ...prev, email: '' }))}
                >
                  ×
                </button>
              )}
            </div>
          </div>

          <div className="form-group">
            <label htmlFor="mobile">Mobile Number</label>
            <div className="input-wrapper">
              <FiPhone className="icon" />
              <input
                type="tel"
                id="mobile"
                name="mobile"
                value={formData.mobile}
                onChange={handleChange}
                placeholder="Enter your mobile number"
                disabled={loading}
              />
              {formData.mobile && (
                <button 
                  type="button"
                  className="clear-input-btn"
                  onClick={() => setFormData(prev => ({ ...prev, mobile: '' }))}
                >
                  ×
                </button>
              )}
            </div>
          </div>

          <div className="form-group">
            <label htmlFor="password">Password *</label>
            <div className="input-wrapper">
              <FiLock className="icon" />
              <input
                type="password"
                id="password"
                name="password"
                value={formData.password}
                onChange={handleChange}
                placeholder="Create a password"
                required
                disabled={loading}
              />
              {formData.password && (
                <button 
                  type="button"
                  className="clear-input-btn"
                  onClick={() => setFormData(prev => ({ ...prev, password: '' }))}
                >
                  ×
                </button>
              )}
            </div>
          </div>

          <div className="form-group">
            <label htmlFor="confirmPassword">Confirm Password *</label>
            <div className="input-wrapper">
              <FiLock className="icon" />
              <input
                type="password"
                id="confirmPassword"
                name="confirmPassword"
                value={formData.confirmPassword}
                onChange={handleChange}
                placeholder="Confirm your password"
                required
                disabled={loading}
              />
              {formData.confirmPassword && (
                <button 
                  type="button"
                  className="clear-input-btn"
                  onClick={() => setFormData(prev => ({ ...prev, confirmPassword: '' }))}
                >
                  ×
                </button>
              )}
            </div>
          </div>

          <div className="form-actions">
            <button 
              type="submit" 
              className="register-btn"
              disabled={loading}
            >
              {loading ? 'Creating Account...' : 'Create Account'}
            </button>

            <button 
              type="button" 
              className="reset-form-btn" 
              onClick={resetForm}
              disabled={loading || (!formData.name && !formData.email && !formData.mobile && !formData.password && !formData.confirmPassword)}
            >
              Clear Form
            </button>
          </div>

          <div className="test-credentials">
            <button 
              type="button" 
              className="test-credentials-btn" 
              onClick={fillTestCredentials}
            >
              Use Test Credentials
            </button>
          </div>
        </form>

        <div className="social-login">
          <p>Or register with</p>
          <div className="social-buttons">
            <button 
              className="social-btn google-btn" 
              onClick={() => handleSocialRegister('Google')}
              type="button"
            >
              <FcGoogle /> Google
            </button>
          </div>
        </div>

        <div className="login-link">
          Already have an account? <Link to="/login">Sign in here</Link>
        </div>
      </div>
    </div>
  );
};

export default Register;
